function EntryForm(){
    return(
    <form>
        <div className="ef border border-primary  rounded">
            <fieldset>
                <legend>Bidding</legend>
                 <div className="input-group pad">
                    <span className="input-group-text">Product </span>
                 </div>
            </fieldset>
        </div>
  </form>
   
    )
}
export default EntryForm;
